def get_timestamp(time_str:str, format_str = "%Y-%m-%d %H:%M:%S"):
	strip_time = time.strptime(time_str, format_str)
	return time.mktime(strip_time)

def get_time_by_stamp(timestamp, format_str = "%Y-%m-%d %H:%M:%S"):
	local_time = time.localtime(timestamp)
	dt = time.strftime(format_str, local_time)
	return dt

